const Pagination = ({ itemsPerPage, totalItems, paginate, currentPage, pageNumbers })=>{
    const pageLinks = pageNumbers.map((number) => (
        <li key={number}>
          <a href="!#" onClick={() => paginate(number)}>
            {number}
          </a>
        </li>
      ));


      return (
        <nav>
      <ul className="pagination">
        <li>
          <a href="!#" onClick={() => paginate(currentPage - 1)}>
            Anterior
          </a>
        </li>
        {pageLinks}
        <li>
          <a href="!#" onClick={() => paginate(currentPage + 1)}>
            Siguiente
          </a>
        </li>
      </ul>
    </nav>
  );
};



export default Pagination;
